  styleUrls: ['./orders.component.css']
})
export class OrdersComponent implements OnInit {
  status: string = "";
  isLoggedIn$: Observable<boolean>;
  currentUser$: Observable<any>;
  orders$: Observable<any[]>;
  myOrder$: Observable<any[]>;

  constructor() {
  
  }

